features.script:
let closed = 'https://wiki.cryptovoxels.com/metal_drawer.vox'
let opened= 'https://wiki.cryptovoxels.com/metal_drawer_-_open.vox'

feature.on('click',e=>{
  if(feature.get('url')==closed){
    feature.set({url:opened})
  }else{
    feature.set({url:closed})
  }
})

