// Script to set parcel as private. Just put this script on any feature. Non allowed users will automatically be kicked.

// By default the list of allowed Wallets is the list of contributors in the parcel. Also the owner of the parcel is always allowed.

// Un-comment this to add to the list of allowed wallets.
//parcel.allow("wallet")
// Un-comment this to remove from the list of allowed wallets.
//parcel.disallow("wallet")

//for example:
// parcel.allow("0x0fA074262d6AF761FB57751d610dc92Bac82AEf9")


parcel.isPrivate = true


/*
Notes:
the user still has to enter the parcel before the script handles him.

See https://wiki.cryptovoxels.com/en/Scripting/Scripting
